import {getCountryData, allCountryPaths} from '../../lib/countries'; 
import Title from '../../components/Title'; 

export default function Post({countryData}) {
    return (
        <Title country={countryData.name} emoji={countryData.emoji}/>
    )
}

export function getStaticPaths() {
    const paths = allCountryPaths(); 
    return {
      paths,
      fallback: false
    }
  }

export function getStaticProps({ params }) {
    const country = getCountryData(params.country); 
    const countryData = country;
    return {
        props: {
            countryData
        }
    }
}
